import "./App.css";

interface MyContextValue {
  text: string;
  setText: (text: string) => void;
}

const MyContextDefault: MyContextValue = {
  text: "",
  setText: () => {},
};

const MyContext = createContext<MyContextValue>(MyContextDefault);

interface MyContextProviderProps {
  children: React.ReactNode;
}
function MyContextProvider({ children }: MyContextProviderProps) {
  const [text, setText] = useState("text1");

  return (
    <MyContext.Provider value={{ text, setText }}>
      {children}
    </MyContext.Provider>
  );
}

function App() {
  return (
    <MyContextProvider>
      <div>
        <MyComponent />
        <Buttons />
      </div>
    </MyContextProvider>
  );
}

function MyComponent() {
  const { text } = useContext(MyContext);
  return <div>{text}</div>;
}

function Buttons() {
  const { setText } = useContext(MyContext);

  return (
    <div>
      <button onClick={() => setText("text1")}>set to text1</button>
      <button onClick={() => setText("text2")}>set to text2</button>
    </div>
  );
}

export default App;
